db.product.insert({"image":"https://m.media-amazon.com/images/I/71458-qB2JL._AC_SY445_.jpg","price":"$5.00","cat":"VHS Tape","description":"VHS FORMAT. 1986, Universal / Amblin', item 83842. 1 hour, 21 minutes. Color, animated. Digitally restored. The great animator, Don Bluth, came up with this wonderful animated feature, following the adventures of Fievel, a boy mouse, who comes to America in the 19th century to find a life free from \"cat persecution.\" He eventually winds up in New York Harbor. Voices here include: Dom deLuise, Madeline Kahn, and the wonderful Christopher Plummer, who these days turns up in just about everything. A genuine children's classic.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Language ‏ : ‎ English Package Dimensions ‏ : ‎ 7.32 x 4.19 x 1.12 inches; 7.36 ounces Director ‏ : ‎ Don Bluth Run time ‏ : ‎ 1 hour and 20 minutes Release date ‏ : ‎ March 6, 2001 Date First Available ‏ : ‎ October 1, 2006 Actors ‏ : ‎ Dom DeLuise, Christopher Plummer, Erica Yohn, Nehemiah Persoff, Amy Green Studio ‏ : ‎ Universal Studios Home Entertainment Producers ‏ : ‎ David Kirschner, Deborah Jelin Newmyer, Don Bluth, Frank Marshall ASIN ‏ : ‎ 0783228503 Writers ‏ : ‎ David Kirschner, Judy Freudberg, Tony Geiss Customer Reviews: 4.8 4.8 out of 5 stars 4,672 ratings","title":"American Tail VHS"});
