db.product.insert({"image":"https://m.media-amazon.com/images/I/91vTLmLgnYL._AC_SY445_.jpg","quantity":"4","price":"$19.99","cat":"VHS Tape","description":"Reflecting an age of innocence and a time of wonder, no film better captures the pure magic of Disney than BAMBI -- the world's most endearing animated tale about the beauty of nature and the miracle of life. Nominated for three Academy Awards(R), this immortal blend of classic storytelling and unforgettable characters is most fondly remembered as Walt Disney's all-time favorite picture. As morning light breaks across the meadow, a new prince of the forest is born. Soon Bambi emerges from the thicket on wobbly legs, much to the delight of his new friends, Thumper, the playful rabbit, and Flower, the bashful yet lovable skunk. But the fun of skating on \"stiff water,\" nibbling fresh blossoms, and frolicking through the woods is only the beginning. Exploring his new world, and guided by the wisdom of Friend Owl, Bambi learns valuable lessons with every adventure --experiencing love, loss, growth, and renewal along the way. Fully restored to its original theatrical splendor, this digitally remastered video edition of BAMBI can now take its place among your most cherished family keepsakes. Relive Disney's extraordinary movie masterpiece \"filled with laughter and inspired animation!\" (Time Magazine)","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Language ‏ : ‎ English Package Dimensions ‏ : ‎ 8.98 x 5.51 x 1.14 inches; 7.2 ounces Director ‏ : ‎ Bill Roberts, David Hand, Graham Heid, James Algar, Norman Wright Run time ‏ : ‎ 1 hour and 9 minutes Release date ‏ : ‎ February 1, 1997 Date First Available ‏ : ‎ February 9, 2007 Actors ‏ : ‎ Hardie Albright, Stan Alexander, Bobette Audrey, Peter Behn, Thelma Boardman Studio ‏ : ‎ Walt Disney Home Video ASIN ‏ : ‎ 0788806270 Writers ‏ : ‎ Carl Fallberg Best Sellers Rank: #52,519 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #224 in Disney Music Customer Reviews: 4.8 4.8 out of 5 stars 8,003 ratings","title":"Bambi (Walt Disney's Masterpiece) [VHS]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/51GCAX7CEHL._AC_SY445_.jpg","price":"$16.49","cat":"VHS Tape","description":"Los Angeles Times: \"...this no-pressure, when-you're-ready, everybody-does-it, demystifying approach is it.\" It's potty time at the Big Blue House as Bear's friends discover that going to the bathroom by yourself is part of the adventure of growing up! Featuring these songs: \"Welcome Song\" \"Potty Chair\" \"Toileteers\" \"Goodbye Song\" Color, not rated, approximate running time 25 minutes.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 7.5 x 4.2 x 1.1 inches; 4 ounces Release date ‏ : ‎ August 31, 1999 Date First Available ‏ : ‎ October 26, 2006 Actors ‏ : ‎ Bear in the Big Blue House Studio ‏ : ‎ Sony Pictures ASIN ‏ : ‎ 076783822X Best Sellers Rank: #265,761 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #3,327 in Children's Music (CDs & Vinyl) Customer Reviews: 4.7 4.7 out of 5 stars 936 ratings","title":"Bear in the Big Blue House - Potty Time with Bear [VHS]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/71P0MMGGGPL.__AC_SX300_SY300_QL70_FMwebp_.gif","price":"$8.99","cat":"VHS Tape","description":"Bernadette Peters is a glorious anachronism, a tiny New Yorker with a big voice, coppery pre-Raphaelite curls, and the sort of ripe physicality that made it logical she should ignore PC and have legendary pinup artist Vargas capture her for an album cover portrait. While most of her musical peers were getting funky, getting in touch with themselves, or getting high, Peters was honing her skills as a musical actress, setting her compass by Broadway with occasional detours to Hollywood. Now Peters is acknowledged as one of the Great White Way's natural wonders, a bona fide Tony-winning musical comedy star performing here in her first full-length video concert.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 7.32 x 4.19 x 1.12 inches; 6.08 ounces Director ‏ : ‎ Gavin Taylor Run time ‏ : ‎ 1 hour and 31 minutes Release date ‏ : ‎ October 26, 1999 Date First Available ‏ : ‎ June 27, 2006 Actors ‏ : ‎ Bernadette Peters, Paul Baker, Glenn Carter, Drew Jaymson, Michael Strassen Studio ‏ : ‎ ACORN MEDIA Producers ‏ : ‎ Ian Martin, Paul Kafno ASIN ‏ : ‎ 1569383421 Customer Reviews: 4.7 4.7 out of 5 stars 49 ratings","title":"Bernadette Peters in Concert VHS"});
