db.product.insert({"image":"https://m.media-amazon.com/images/I/816ExVZtNOS._SX425_.jpg","form":"Live","price":"$16.98","cat":"Audio CD","description":"This is the debut CD from one of today's best comedians. Brian has been on Letterman 5 times, he did the Tonight Show with Johnny Carson, and he had his own comedy special on Showtime called Something's Wrong with the Regan Boy. This CD features all his favorite routines including \"School Routine,\" \"Little League Baseball,\" \"Putting His Foot in His Mouth\" and more.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Language ‏ : ‎ English Product Dimensions ‏ : ‎ 5.5 x 0.5 x 5 inches; 3.2 ounces Manufacturer ‏ : ‎ Uproar Original Release Date ‏ : ‎ 1997 Date First Available ‏ : ‎ October 21, 2005 Label ‏ : ‎ Uproar ASIN ‏ : ‎ 1929243154 Number of discs ‏ : ‎ 1 Best Sellers Rank: #34,363 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #14,991 in Pop (CDs & Vinyl) Customer Reviews: 4.7 4.7 out of 5 stars 311 ratings","title":"Brian Regan Live"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/51HSjjezLEL._SX300_SY300_QL70_FMwebp_.jpg","price":"$9.00","cat":"DVD","description":"As Carole King herself puts it during this concert performance in Hartford, Connecticut, the tunes on this video will represent either a trip down memory lane for the viewer--or a music-history lesson. King includes a couple of unfamiliar songs (from her then-new 1993 album, Colour of Your Dreams), but devotes most of this 85-minute set to the hits and highlights of her career, with a large, energetic band and backup singers (including her daughter). Those include such early song-writing successes as \"One Fine Day,\" \"Up on the Roof,\" and \"Natural Woman,\" as well as the still-classic tunes from her ground-breaking Tapestry album: \"So Far Away,\" \"Will You Love Me Tomorrow?\", \"It's Too Late,\" and \"You've Got a Friend.\" King herself is frisky as a pony, working the stage with the flair of Tina Turner and even bringing out unlikely guest-star guitarist Slash to provide chunky, chugging guitar on \"Locomotion.\" --Marshall Fine","details":"Product details MPAA rating ‏ : ‎ Unrated (Not Rated) Product Dimensions ‏ : ‎ 7.5 x 5.5 x 0.75 inches; 4 ounces Media Format ‏ : ‎ Color, NTSC Run time ‏ : ‎ 1 hour and 22 minutes Release date ‏ : ‎ May 30, 2000 Actors ‏ : ‎ Carole King Studio ‏ : ‎ Kultur Video ASIN ‏ : ‎ 0769716903 Number of discs ‏ : ‎ 1 Best Sellers Rank: #296,150 in Movies & TV (See Top 100 in Movies & TV) #6,166 in Soft Rock (CDs & Vinyl) #8,899 in Adult Contemporary (CDs & Vinyl) #11,095 in Pop Singer-Songwriters Customer Reviews: 3.9 3.9 out of 5 stars 10 ratings","title":"Carole King - In Concert"});
