db.product.insert({"image":"https://m.media-amazon.com/images/I/61YgilNinQL._SX385_.jpg","cat":"DVD","description":"Jump into the dynamic world of pop megastar, Gloria Estefan as she takes you behind the scenes on her most recent U.S. and European tour. This program features twelve videos including \"Oye,\" \"Don't Stop,\" \"Turn The Beat Around,\" \"Higher,\" \"Everlasting Love,\" and others, interspersed with interview moments.","details":"Product details Aspect Ratio ‏ : ‎ 1.33:1 Is Discontinued By Manufacturer ‏ : ‎ No MPAA rating ‏ : ‎ NR (Not Rated) Product Dimensions ‏ : ‎ 5.3 x 7.5 x 0.62 inches; 4 ounces Media Format ‏ : ‎ Dolby, NTSC, Color, DVD Run time ‏ : ‎ 2 hours and 22 minutes Release date ‏ : ‎ December 22, 1998 Actors ‏ : ‎ Gloria Estefan Dubbed: ‏ : ‎ Spanish Subtitles: ‏ : ‎ English Language ‏ : ‎ English (PCM Stereo), English (Dolby Digital 5.1) Studio ‏ : ‎ Sony Legacy ASIN ‏ : ‎ 1573301108 Number of discs ‏ : ‎ 1 Best Sellers Rank: #229,249 in Movies & TV (See Top 100 in Movies & TV) #3,785 in Performing Arts (Movies & TV) #4,117 in Latin Pop (CDs & Vinyl) #6,939 in Adult Contemporary (CDs & Vinyl) Customer Reviews: 4.4 4.4 out of 5 stars 27 ratings","title":"Dont Stop! [DVD]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/51F5ZFNFDWL._AC_SY445_.jpg","price":"$9.00","cat":"VHS Tape","description":"Make way for spells, witches, wizards and adventure! It's Halloween, the scariest, funnest event of Fall. But for Lynn and Kelly farmer (Mary-Kate & Ashley Olsen) something scarier could happen. A slump in the family business means the farmers will lose their home--unless the spirited twins find a way to save it! Year: 1993 Director: Stuart Margolin Starring: Mary-Kate & Ashley Olsen, Cloris Leachman, Meshach Taylor","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 8.7 x 5.4 x 1.2 inches; 8 ounces Release date ‏ : ‎ August 26, 1997 Date First Available ‏ : ‎ December 7, 2006 Actors ‏ : ‎ Mary-Kate Olsen & Ashley Studio ‏ : ‎ Warner Home Video ASIN ‏ : ‎ 0790724960 Best Sellers Rank: #292,446 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #3,637 in Children's Music (CDs & Vinyl) Customer Reviews: 4.7 4.7 out of 5 stars 4,075 ratings","title":"Double, Double, Toil & Trouble [VHS]"});
