db.product.insert({"image":"https://m.media-amazon.com/images/I/81rSnHzgtdL._AC_SY445_.jpg","price":"$19.99","cat":"VHS Tape","description":"Sesame Street's cheerful redhead chuckles his way through this delightful 50-minute compilation of three favorite \"Elmo's World\" episodes. First come the babies: real babies, Muppet babies, and animal babies. With help from Mister Noodle, a cast of Muppets, and video vignettes featuring humans, Elmo discovers what babies can do and how to play with them. Next come the dogs. Once again, Elmo's on the move--this time to share important tips about respecting the family pet. The final episode examines life on the farm. Viewers will observe youngsters accomplishing daily farm chores as well as Muppet farmers and barn animals punning around. As Elmo bops around his house (simply drawn and \"furnished\" with color crayon sketches), he chats with Dorothy the pet goldfish, poses questions to Mister Noodle, and tunes in to his friendly television for helpful cartoons presented by \"The Baby Channel,\" \"The Dog Channel,\" and of course, \"The Farm Channel.\" Educational and entertaining for the younger crowd, each segment explores its topic using a variety of creative, quick-paced methods, enhanced by an upbeat soundtrack. (Ages 3 to 6) --Liane Thomas","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 7.5 x 3.8 x 1.1 inches; 5.6 ounces Release date ‏ : ‎ May 2, 2000 Date First Available ‏ : ‎ November 6, 2006 Actors ‏ : ‎ Elmo's World Studio ‏ : ‎ Sony Wonder ASIN ‏ : ‎ 0738920363 Best Sellers Rank: #208,554 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #2,641 in Children's Music (CDs & Vinyl) Customer Reviews: 4.7 4.7 out of 5 stars 516 ratings","title":"Elmo's World - Babies, Dogs & More! VHS"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/71d9xEa8wOL._AC_SX385_.jpg","price":"$17.99","cat":"VHS Tape","description":"Basically, this is a collection of songs from 30 years of Sesame Street, in which sweet Elmo and his Muppet pals are joined by David Alan Grier, Jon Stewart, Gloria Estefan, the Fugees, Shawn Colvin, and the Mighty Mighty Bosstones. Grier (of the comically sour face) and Stewart (of the ironic smile) provide some funny stuff, and the Muppets share songs with the musical guests. This nonstop revue is a blast for parents as well as little ones. --Tom Keogh","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Product Dimensions ‏ : ‎ 5.3 x 8.8 x 1.1 inches; 8 ounces Run time ‏ : ‎ 50 minutes Release date ‏ : ‎ April 14, 1998 Date First Available ‏ : ‎ October 1, 2006 Actors ‏ : ‎ Sesame Street Studio ‏ : ‎ Sony Wonder ASIN ‏ : ‎ 157330574X Best Sellers Rank: #146,044 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #1,841 in Children's Music (CDs & Vinyl) Customer Reviews: 4.0 4.0 out of 5 stars 30 ratings","title":"Elmopalooza VHS"});
