db.product.insert({"image":"https://m.media-amazon.com/images/I/91v2gALfYDL._SY450_.jpg","price":"$7.98","cat":"Audio CD","description":"Reviews: 'What a sublime way to heal body and mind during stressful times. I highly recommend it.' Dr. Carole Weingrod; Diplomate, American College of Psychiatry and Nuerology. 'What an amazing tool. It is both beautiful and powerful in it's ability to train one in the art of serenity.' Dr. Allan Jacob, President, Orion Medical. 'This is a powerful CD to heal both mind and body. The health benefits are powerful and it is beautifully soothing and peaceful.' Anabelle Vitale. Bay Harbour Med Spa. 'Quiet your mind and your heart will follow. Roberta's poetic prose draws you in and helps you to be in touch with healing insight and wisdom. M. Meinstein, Editor, MNow Magazine. Roberta Shapiro is a renowned psychotherapist in private practice in Miami, Florida. She is a member of the American Society for Clinical Hypnotherapists, the Anxiety Disorder's Association of America, the National Board of Certified Clinical Hypnotherapists, the American Psychiatric and Medical Hypnosis Association and in the Marquis Edition of Who's Who in American Women. She is the author of Birth Pains, Dying to Run, and the the CD Sleep Solutions. This is the second in her series, the Calming Collection. Coming soon is Goodbye Fear (calm flying and driving).","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Product Dimensions ‏ : ‎ 5.6 x 0.4 x 4.9 inches; 3.04 ounces Manufacturer ‏ : ‎ CD Baby Original Release Date ‏ : ‎ 2010 Date First Available ‏ : ‎ October 20, 2010 Label ‏ : ‎ CD Baby ASIN ‏ : ‎ 1450734618 Number of discs ‏ : ‎ 1 Best Sellers Rank: #71,083 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #177 in New Age Relaxation Music Customer Reviews: 4.4 4.4 out of 5 stars 572 ratings","title":"Goodbye Worries"});
