db.product.insert({"image":"https://m.media-amazon.com/images/I/41B6B1pl78L._SX425_.jpg","price":"$21.32","cat":"Audio CD","description":"Lou Reeds fans have learned to expect the unexpected, but his latest work may still come as a surprise. After four decades in the rock spotlight, Lou Reed has turned his attention to the world of meditation music, inviting listeners on a relaxing journey to the hidden territory of his inner landscape. With Lou Reed's Inner Spaces, the iconic art rocker presents his first album created specifically for quiet contemplation. A practitioner of yoga and tai chi for many years, Lou Reed brings his unique sensitivity and knowledge of a broad spectrum of musical genres to provide a tranquil bed of soothing harmonics that open the heart and settle the mind. Like the music Reed composed for meditation and absorption of the photographic image in his book Lou Reed's New York (Steidl, 2006), the pieces on this hypnotic album wash away tension and negative energy with sparse instrumentation and subtle waves of electronic sound. Includes a bonus CD featuring Imaginary Shower, a guided relaxation exercise by Lou Reed's acupuncturist and healer, Dr. Shelley Peng.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Language ‏ : ‎ English Product Dimensions ‏ : ‎ 5.75 x 0.5 x 5 inches; 4 ounces Manufacturer ‏ : ‎ Sounds True Pages ‏ : ‎ 1 Item model number ‏ : ‎ 2069115 Date First Available ‏ : ‎ February 2, 2007 Label ‏ : ‎ Sounds True ASIN ‏ : ‎ 1591795540 Number of discs ‏ : ‎ 1 Best Sellers Rank: #215,226 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #2,322 in New Age Meditation Music #17,450 in International Music (CDs & Vinyl) #91,369 in Rock (CDs & Vinyl) Customer Reviews: 4.0 4.0 out of 5 stars 30 ratings","title":"Hudson River Wind Meditations"});
