db.product.insert({"image":"https://m.media-amazon.com/images/I/21F8ZBGBN1L.__AC_QL70_FMwebp_.jpg","price":"$35.92","cat":"VHS Tape","description":"One of the most startling, exciting live performances in rock history is presented here in all its glory. The Jimi Hendrix Experience were already making a name for themselves in England but were little known in the States when they appeared at Monterey in June 1967; that all changed after this gig, which saw Hendrix and his trio play an electrifying mix of originals (\"Purple Haze,\" \"Foxy Lady,\" \"The Wind Cries Mary\") and covers (\"Hey Joe,\" \"Like a Rolling Stone,\" and the climactic \"Wild Thing,\" in which the guitarist set his instrument on fire). For a new high-definition digital transfer with a 5.1 audio mix, try The Complete Monterey Pop Festival on DVD. --Sam Graham","details":"Product details Package Dimensions ‏ : ‎ 7.32 x 4.19 x 1.12 inches; 7.36 ounces Director ‏ : ‎ Chris Hegedus, D.A. Pennebaker Run time ‏ : ‎ 50 minutes Release date ‏ : ‎ June 17, 1997 Date First Available ‏ : ‎ February 9, 2007 Actors ‏ : ‎ Jimi Hendrix, Noel Redding, Mitch Mitchell, John Phillips, George Harrison Studio ‏ : ‎ Wea Corp Producers ‏ : ‎ Alan Douglas, Frazer Pennebaker ASIN ‏ : ‎ 1566053358 Best Sellers Rank: #773,753 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #8,061 in Classic Psychedelic Rock #11,313 in Blues Rock (CDs & Vinyl) #58,581 in Metal Customer Reviews: 4.6 4.6 out of 5 stars 12 ratings","title":"Jimi Plays Monterey [VHS]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/810Y5i76YJL._SY445_.jpg","quantity":"30","price":"$11.99","cat":"DVD","description":"This is the first live home video in Ozzy's illustrious solo career. The nearly two-hour program was filmed by director Jeb Brien throughout Ozzy's tow 1992 sold-out U.S. tours, \"Theater of Madness\" and \"No More Tours,\" and includes many of Ozzy's biggest hits.","details":"Product details Aspect Ratio ‏ : ‎ 1.33:1 Is Discontinued By Manufacturer ‏ : ‎ No MPAA rating ‏ : ‎ Unrated (Not Rated) Product Dimensions ‏ : ‎ 5.3 x 7.5 x 0.62 inches; 1.06 ounces Item model number ‏ : ‎ Relay Time: 112 min Media Format ‏ : ‎ Color, NTSC, Multiple Formats Run time ‏ : ‎ 3 hours and 48 minutes Release date ‏ : ‎ September 30, 1997 Actors ‏ : ‎ Ozzy Osbourne Language ‏ : ‎ English (Dolby Digital 2.0 Stereo), Unqualified (DTS ES 6.1) Studio ‏ : ‎ Legacy Recordings ASIN ‏ : ‎ 1573300411 Country of Origin ‏ : ‎ USA Number of discs ‏ : ‎ 1 Best Sellers Rank: #29,294 in Movies & TV (See Top 100 in Movies & TV) #83 in British Metal (CDs & Vinyl) #191 in British Music #193 in Performing Arts (Movies & TV) Customer Reviews: 4.7 4.7 out of 5 stars 624 ratings","title":"LIVE & LOUD"});
