db.product.insert({"image":"https://m.media-amazon.com/images/I/717khXPmwJL._SY445_.jpg","price":"$14.89","cat":"DVD","description":"Like so many living legends and phenomenal talents, Stevie Ray died in a helicopter crash in 1991. Luckily, there are scores of recordings documenting the genius of this Texan blues guitarist, including these appearances on Austin City Limits and more. 1983-89/color/63 min/NR/fullscreen.","details":"Product details Aspect Ratio ‏ : ‎ 1.33:1 Is Discontinued By Manufacturer ‏ : ‎ No MPAA rating ‏ : ‎ NR (Not Rated) Product Dimensions ‏ : ‎ 7.46 x 5.35 x 1.93 inches; 2.56 ounces Item model number ‏ : ‎ 2230621 Media Format ‏ : ‎ Multiple Formats, NTSC, Color Run time ‏ : ‎ 2 hours and 4 minutes Release date ‏ : ‎ September 2, 1997 Actors ‏ : ‎ Stevie Ray Vaughan & Double Trouble Subtitles: ‏ : ‎ English Language ‏ : ‎ Unqualified, English (Dolby Digital 2.0 Surround) Studio ‏ : ‎ Legacy Recordings ASIN ‏ : ‎ 157330056X Number of discs ‏ : ‎ 1 Best Sellers Rank: #24,060 in Movies & TV (See Top 100 in Movies & TV) #22 in Texas Blues #68 in Modern Blues (CDs & Vinyl) #87 in Electric Blues Customer Reviews: 4.7 4.7 out of 5 stars 889 ratings","title":"Live From Austin Texas"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/41JMJXPARDL._AC_SY445_.jpg","cat":"VHS Tape","description":"Behind every great suspense film lies the shadow of M, a fact-based drama that is the first and, perhaps, the ultimate portrait of a serial killer. Peter Lorre's flawless performance as a psychotic child murderer elicits feelings of both fear and pity. Lorre (Casablanca), in his first starring role, conveys the agony of a man driven by his compulsions, tormented by self-loathing, and hunted by both the criminal underworld and the police. M, director Fritz Lang's (Metropolis) first sound film and personal favorite, skillfully blends innovative camerawork, fine acting, and atmospheric settings. This version includes the often missing final scene and a restored sound track.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 7.32 x 4.19 x 1.12 inches; 6.13 ounces Release date ‏ : ‎ June 13, 2000 Date First Available ‏ : ‎ February 9, 2007 Actors ‏ : ‎ Lorre, Widmann Studio ‏ : ‎ Home Vision Cinema ASIN ‏ : ‎ 0780018664 Best Sellers Rank: #509,447 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #6,212 in Children's Music (CDs & Vinyl) Customer Reviews: 4.6 4.6 out of 5 stars 1,339 ratings","title":"M [VHS]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/71x-y84QaiL._AC_SX522_.jpg","price":"$9.99","cat":"VHS Tape","description":"The schoolgirl adventures of Madeline, a flame-haired orphan, are lovingly adapted from Ludwig Bemelmans's classic children's books. His sly and witty writing is transferred to this first-rate film, one that should not be thought of merely as childhood entertainment. Spunky Madeline is most adept at finding trouble. She is also a quick-witted and likable child who can solve almost any problem. Her latest scheme is to keep her school, which is also her home, from being sold by its owner, the recently widowed Lord Covington (Nigel Hawthorne). Unlike most youthful movie fare, this adventure boasts high production values that wisely include colorful Parisian locations. Hatty Jones is all spunky self-sufficiency and sweet innocence in the title role, and Frances McDormand is quite humorous as the stern school-mistress, Miss Clavel. --Rochelle O'Gorman","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 7.32 x 4.19 x 1.12 inches; 6.08 ounces Release date ‏ : ‎ December 15, 1998 Date First Available ‏ : ‎ October 26, 2006 Actors ‏ : ‎ Mcdormand, Hawthorne Studio ‏ : ‎ Sony Pictures ASIN ‏ : ‎ 0767816641 Best Sellers Rank: #193,822 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #2,444 in Children's Music (CDs & Vinyl) Customer Reviews: 4.7 4.7 out of 5 stars 1,906 ratings","title":"Madeline [VHS]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/71AXzNbv4IL._AC_SX522_.jpg","cat":"VHS Tape","description":"\"Society has traditionally always tried to find scapegoats for its problems. Well, here I am.\" - Marilyn Manson October 1996 The controversial events from the Antichrist Superstar Tour serve as the backdrop for this amazing document, all as seen through the video eye of the band's own cameraman. The picketing zealots, the fulminating moralists, the disingenuous politicians, the tens of thousands who came to see for themselves and, of course, gazing outward from the very heart of the storm, Manson himself. One hour of live concert performances intercut with behind the scene and backstage footage that will help you to understand what it must have been like to be at the center of these extraordinary occurrences.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Language ‏ : ‎ English Package Dimensions ‏ : ‎ 7.5 x 4.2 x 1.1 inches; 5.6 ounces Release date ‏ : ‎ February 10, 1998 Date First Available ‏ : ‎ October 1, 2006 Actors ‏ : ‎ Marilyn Manson Studio ‏ : ‎ Interscope Records ASIN ‏ : ‎ 1573623806 Best Sellers Rank: #332,867 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #367 in Music Videos & Concerts (Movies & TV) #3,001 in Alternative Metal (CDs & Vinyl) #28,462 in Alternative Rock (CDs & Vinyl) Customer Reviews: 4.2 4.2 out of 5 stars 33 ratings","title":"Marilyn Manson - Dead to the World [VHS]"});
