db.product.insert({"image":"https://m.media-amazon.com/images/I/41ADYHJEX7L.__AC_SX300_SY300_QL70_FMwebp_.jpg","price":"$10.40","cat":"VHS Tape","description":"The Tony Award-winning originator of the title role in the global stage success The Phantom of the Opera, Michael Crawford brings his unique voice and charismatic presence to this one-of-a-kind concert event. Crawford performs Broadway, inspirational and traditional favorites at the Cerritos Center in Los Angeles. For his signature Phantom songs, he is joined by Dale Kristien, his co-star in the Los Angeles company of that show. He salutes that show's creator Andrew Lloyd Webber with tunes from two of the composer's other musicals. Experience Michael Crawford in Concert and savor a magical performance specifically staged for home viewing. 64 minutes.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 7.32 x 4.19 x 1.12 inches; 6.13 ounces Release date ‏ : ‎ May 26, 1998 Date First Available ‏ : ‎ October 26, 2006 Actors ‏ : ‎ Crawford, Michael Studio ‏ : ‎ Warner Home Video ASIN ‏ : ‎ 0790735628 Best Sellers Rank: #480,824 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #28,327 in Vocal Pop (CDs & Vinyl) Customer Reviews: 4.3 4.3 out of 5 stars 78 ratings","title":"Michael Crawford in Concert [VHS]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/71btbdKv7WL._AC_SX522_.jpg","cat":"VHS Tape","description":"The first great rock concert documentary by the filmmaker who invented the form. D.A. Pennebaker (who teamed up with Richard Leacock, Albert Maysles, and other filmmakers here), fresh off his Bob Dylan documentary, Don't Look Back, captured the music and scene of the first real rock & roll festival. The Monterey Pop Festival of 1967, which laid the groundwork for Woodstock two years later, offered an amazing array of talent that was absolutely of that moment. And, as the intervening years have shown, this music stood the test of time: from the young Janis Joplin blowing the crowd away with \"Ball and Chain\" to an instrument-smashing performance by the Who to the surprisingly soul-stirring showing by Otis Redding. One particular highlight: the American debut of a little-known rock trio called the Jimi Hendrix Experience, which knocked the crowd out of its seats with a guitar sound that had never been heard before--and culminated with Hendrix setting his guitar ablaze and worshipping the flaming feedback. --Marshall Fine","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Language ‏ : ‎ English Package Dimensions ‏ : ‎ 7.32 x 4.19 x 1.12 inches; 6.13 ounces Release date ‏ : ‎ June 17, 1997 Date First Available ‏ : ‎ October 1, 2006 Actors ‏ : ‎ Mamas & Papas, Animals, Joplin, Canned Heat, Hendrix Studio ‏ : ‎ Wea/Rhino ASIN ‏ : ‎ 156605334X Customer Reviews: 4.2 4.2 out of 5 stars 19 ratings","title":"Monterey Pop-the Film"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/519P1PQSWZL._SY445_.jpg","price":"$14.99","cat":"DVD","description":"A ratings disaster when it premiered on the ABC network on September 22, 1969 (and lasting a mere 16 weeks before cancellation), Music Scene now stands as a sublime time capsule of the \"flower power\" era. Although it was smartly conceived by the hipper-than-average producers of the controversial Smothers Brothers Comedy Hour, the show was riskily scheduled opposite ratings juggernauts Gunsmoke and Laugh-In, and its fate was sealed. Now, with the passage of decades, these shows display a laudable effort to lure serious rock music into the pop-cultural mainstream--there were few if any opportunities for these acts to gain prime-time TV exposure, so it wasn't unusual to find Janis Joplin, Sly & the Family Stone, or Crosby, Stills, Nash & Young colliding on the guest list with bubble-gum pop stars like Bobby Sherman and MOR crooners like Steve Lawrence and Eydie Gorme.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No MPAA rating ‏ : ‎ Unrated (Not Rated) Product Dimensions ‏ : ‎ 7.5 x 4.25 x 0.5 inches; 3.2 ounces Media Format ‏ : ‎ Color, NTSC, Full Screen, DVD Run time ‏ : ‎ 45 minutes Release date ‏ : ‎ October 17, 2000 Actors ‏ : ‎ David Steinberg, Chris Bokeno, Larry Hankin, Paul Reid Roman, Christopher Ross Subtitles: ‏ : ‎ English, French, Spanish Language ‏ : ‎ English Studio ‏ : ‎ Mpi Home Video ASIN ‏ : ‎ 0788602136 Number of discs ‏ : ‎ 1 Best Sellers Rank: #190,124 in Movies & TV (See Top 100 in Movies & TV) #803 in Roadhouse Country #2,655 in Funk (CDs & Vinyl) #3,238 in Traditional Folk (CDs & Vinyl) Customer Reviews: 3.6 3.6 out of 5 stars 18 ratings","title":"Music Scene - The Best of 1969-70 [DVD]"});
