db.product.insert({"image":"https://m.media-amazon.com/images/I/91vng5Q+tDL._AC_SY445_.jpg","cat":"VHS Tape","description":"Rage Against the Machine released this self-titled video in 1997. The tape collects live concert footage and music videos of some of their best material. Rage Against the Machine starts with a passionate rendition of Bruce Springsteen's \"Ghost of Tom Joad\" live from the Irvine Meadows in Irvine, CA. The well-filmed performance captures Rage near the top of their game. (Will listeners ever see a collection that includes the concert from the Democratic Convention?) Seeing Zack de la Rocha interact with a large crowd and the band work a tight, incendiary groove is required to understand the appeal of the now-defunct political rock band. This is underscored by \"People of the Sun\" and four other songs live from the Rock Am Ring Festival in Germany, where Rage plays before what must be 100,000 people. Rage Against the Machine also includes three songs from the 1996 Reading Festival and a blistering \"Killing in the Name\" from the 1994 Pink Pop Festival. The second half is filled with six music videos, including \"Freedom\" and \"Memory of the Dead (Land and Liberty).\" Overall, the quality of the video is fine, but the music mix is low and a bit muddy. This is a problem for viewers who want to understand every word de la Rocha says. But there is a lyrics function, which is like subtitling. What musical crispness they lack in concert, Rage makes up for in intensity and energy. The real plus of the collection is that the videos are the uncensored versions, so getting this collection is not like replicating an MTV experience. The best moment of the DVD is a concert appearance by Tom Morello's mother, who plugs boycotting record stores that censor albums and introduces the \"best band in the f*cking universe: Rage Against the Machine!\" A must-own for fans of Rage Against the Machine and a useful 80 minutes for people who are complacent politically.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Product Dimensions ‏ : ‎ 5.7 x 7.6 x 1.6 inches; 11.2 ounces Run time ‏ : ‎ 1 hour and 31 minutes Release date ‏ : ‎ November 25, 1997 Date First Available ‏ : ‎ October 7, 2006 Actors ‏ : ‎ Rage Against The Machine Studio ‏ : ‎ Sony Legacy ASIN ‏ : ‎ 1573300497 Best Sellers Rank: #730,263 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #5,511 in Alternative Metal (CDs & Vinyl) #59,670 in Alternative Rock (CDs & Vinyl) #269,014 in Rock (CDs & Vinyl) Customer Reviews: 4.3 4.3 out of 5 stars 116 ratings","title":"Rage Against The Machine"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/91KOMAoJ2VL._SY445_.jpg","price":"$9.35","cat":"DVD","description":"Riverdance, the Irish hard-shoe sensation that took PBS viewers by storm, underwent its second incarnation with Live from New York City, a 1996 performance filmed at Radio City Music Hall. While most of the attributes from 1995's Riverdance: The Show remain--the dazzling ensemble choreography, Bill Whelan's energetic score, and the New Age-y view of Celtic mythology--the most significant difference is at the top, where Colin Dunne replaced bombastic lead dancer Michael Flatley. Though lacking Flatley's bravura, Dunne is a superb technician who works well with Flatley's former co-lead, Jean Butler. Flamenco dancer Maria Pagis returns, as do the Riverdance Singers (formerly known as Anuna) with soloist Katie McMahon and the orchestra with fiery fiddler Eileen Ivers.","details":"Product details Aspect Ratio ‏ : ‎ 1.78:1 Is Discontinued By Manufacturer ‏ : ‎ No MPAA rating ‏ : ‎ NR (Not Rated) Product Dimensions ‏ : ‎ 7.5 x 5.38 x 0.6 inches; 1.6 ounces Item model number ‏ : ‎ 79949 Director ‏ : ‎ John McColgan Media Format ‏ : ‎ Anamorphic, Color, Dolby, Widescreen, DVD, NTSC Run time ‏ : ‎ 1 hour and 43 minutes Release date ‏ : ‎ January 1, 1997 Actors ‏ : ‎ Jean Butler, Colin Dunne, Mara Pags, Katie McMahon, Morgan Crowley Language ‏ : ‎ English (Dolby Digital 2.0 Stereo), English (Dolby Digital 5.0) Studio ‏ : ‎ Sony Pictures ASIN ‏ : ‎ 0767804341 Number of discs ‏ : ‎ 1 Best Sellers Rank: #78,904 in Movies & TV (See Top 100 in Movies & TV) #109 in Celtic New Age (CDs & Vinyl) #216 in Irish Music #738 in British Music Customer Reviews: 4.5 4.5 out of 5 stars 597 ratings","title":"Riverdance - Live From New York City [DVD]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/61lHDvue87L._AC_SY445_.jpg","price":"$8.99","cat":"VHS Tape","description":"Scooby-Doo, Shaggy, Velma, Daphne and Fred reunite to solve the most frightfully funny mystery of their careers. The scream team's headed to a haunted bayou island to investigate the ghost of Moonscar the Pirate. But it turns out the swashbuckler's spirit isn't the only creepy character on the island.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 8.8 x 5.5 x 1.2 inches; 8.8 ounces Release date ‏ : ‎ September 22, 1998 Date First Available ‏ : ‎ October 25, 2006 Actors ‏ : ‎ Scooby Doo Studio ‏ : ‎ Warner Home Video ASIN ‏ : ‎ 1560395737 Best Sellers Rank: #78,056 in Prime Movies #286,104 in Prime TV Shows Customer Reviews: 4.8 4.8 out of 5 stars 6,421 ratings","title":"Scooby-Doo on Zombie Island [VHS]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/81R8rwYSX4L._AC_SY445_.jpg","price":"$9.89","cat":"VHS Tape","description":"For those who can't get enough of those Barney songs, here's a made-for-video show packed full of song and dance. The story line is oh-so thin as Barney and his friends sing 27 songs in only 56 minutes, so Barney is usually singing or introducing a new song. For anyone who has been watching the decade that Barney has been on the airwaves, most of the songs are Barney standards: \"Mr. Sun,\" \"The Airplane Song,\" \"Baby Bop Hop,\" and \"I Love You.\" They are mixed in with all-time favorites \"Itsy Bitsy Spider,\" \"A Camping We Will Go,\" and the like. Many of Barney's original kid friends return looking much older and wiser. No big landmark production here, just a \"greatest hits\" of Barney tunes that should have fans singing and dancing around the tube for nearly an hour.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 7.4 x 4.2 x 1.1 inches; 0.01 ounces Release date ‏ : ‎ January 12, 1999 Date First Available ‏ : ‎ February 9, 2007 Actors ‏ : ‎ Barney Studio ‏ : ‎ Universal Studios Home Entertainment ASIN ‏ : ‎ 1571323767 Customer Reviews: 4.5 4.5 out of 5 stars 535 ratings","title":"Sing and Dance with Barney [VHS]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/215683XWVAL.__AC_QL70_FMwebp_.jpg","cat":"VHS Tape","description":"A powerful and moving work, Spartacus shows episodes from an uprising of slaves in Ancient Rome. The dramatic effects of this action are played out by those swept up in the action: Spartacus, his wife Flavia and Crassus, commander of the Roman Army. Stars Lisa Pavane and Steven Heathcote. The Australian Ballet.","details":"Product details Package Dimensions ‏ : ‎ 7.32 x 4.19 x 1.12 inches; 6.13 ounces Release date ‏ : ‎ May 30, 2000 Date First Available ‏ : ‎ October 26, 2006 Actors ‏ : ‎ Australian Ballet Studio ‏ : ‎ Kultur Video ASIN ‏ : ‎ 0769721125 Customer Reviews: 4.8 4.8 out of 5 stars 7 ratings","title":"Spartacus [VHS]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/51DSNWKX3HL._AC_SY445_.jpg","price":"$13.97","cat":"VHS Tape","description":"Stomp is a rhythmic, musical extravaganza that has stunned audiences across the globe. If you weren't lucky enough to catch them in your hometown (or you did and you crave more), now there's Stomp Out Loud, a special HBO performance that will bring the unusual musical feats right into your living room. You might just find yourself grabbing a broom or even your remote control to keep time. \"It's comedy, it's theater, it's very physical, it's energetic, it's occasionally quite terrifying,\" says one performer. Taking their show from the theater to the streets, this astonishing troupe can make music out of just about anything and just about anywhere. The opening sequence shows them dangling by harnesses across the back of a Manhattan billboard drumming on hubcaps, pipes, street signs, and plastic garbage pails, all the while swaying and keeping in perfect time. You know how you like to groove along to the radio while driving? Stomp doesn't need a radio--they use their hands to make their own music while cruising the streets of New York. Using just basketballs in a steamy alleyway, the troop creates an incredibly intricate dance and sound with the street, brick walls, and Dumpsters. Included in the program are the push broom, garbage can, and pole dances, just a few of their best-known sequences. Stomp Out Loud showcases the performers in the theater, out about town, and in short humorous vignettes (love the recurring card game!). All in all, they amaze. This well-produced video also includes a trailer and a special behind-the-scenes look at the making of Stomp Out Loud. --Dana Van Nest","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 7.3 x 4 x 1.1 inches; 7.2 ounces Release date ‏ : ‎ April 21, 1998 Date First Available ‏ : ‎ October 25, 2006 Actors ‏ : ‎ Stomp Out Loud Studio ‏ : ‎ Hbo Home Video ASIN ‏ : ‎ 0783112793 Best Sellers Rank: #402,845 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #25,169 in Soundtracks (CDs & Vinyl) Customer Reviews: 4.5 4.5 out of 5 stars 401 ratings","title":"Stomp Out Loud"});
