db.product.insert({"image":"https://m.media-amazon.com/images/I/91MXZsknOyL._AC_SY445_.jpg","price":"$6.99","cat":"VHS Tape","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Language ‏ : ‎ English, French Package Dimensions ‏ : ‎ 7.5 x 4.3 x 1.1 inches; 2.4 ounces Release date ‏ : ‎ March 28, 2000 Date First Available ‏ : ‎ September 29, 2006 Actors ‏ : ‎ Hoag, Koteas, Serra, Forman, Sisti Studio ‏ : ‎ New Line Home Video ASIN ‏ : ‎ 0780607287 Best Sellers Rank: #302,295 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #3,759 in Children's Music (CDs & Vinyl) Customer Reviews: 4.8 4.8 out of 5 stars 8,054 ratings","title":"Teenage Mutant Ninja Turtles - The Original Movie [VHS]"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/81mnO3dv3JL.__AC_SX300_SY300_QL70_FMwebp_.jpg","price":"$9.95","cat":"VHS Tape","description":"Victor Borge was a master at combining two seemingly disparate elements: comedy and classical music. While the Dane's dapper dignity fit the image of \"longhair\" music, Borge undercut it with broad physical comedy, clever spoofs, and off-the-cuff wit. A pioneer in the field of live comedy recordings, Borge is nevertheless best appreciated on video, and The Best of Victor Borge Acts One and Two captures a 90-minute concert that includes many of his most famous routines. He chides late-arriving members of the Minneapolis audience (\"I come from Copenhagen and was here before you!\"), falls off the piano bench, and reads his sheet music upside down. There are a few unwitting guests: a stagehand drafted to turn Borge's pages, soprano Marylyn Mulvey who tries to sing a Verdi aria through Borge's teasing and scolding, and Sahan Arzruni as he and Borge play a two-piano Hungarian rhapsody on a single piano by climbing over and around each other. Borge also presents an opera \"written by Mozart but credited to Salieri\" (\"so you can imagine what kind of opera it is\") and proves that he's not merely a clown by skillfully performing a set of waltzes and lullabies. In addition, two of his best-loved sketches are nonmusical: Inflationary Language, in which numbers in language, like the economy, are increased (\"I'll go back to Elevenessee.... Three-dleoo.\"), and Phonetic Punctuation, in which a period is read aloud to sound like fft and an exclamation point fsss fft. Like Anna Russell and PDQ Bach, Victor Borge helped make classical music accessible to a wide audience by showing that it could be laugh-out-loud funny. --David Horiuchi","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 7.4 x 4.2 x 1.1 inches; 5.64 ounces Director ‏ : ‎ Ronald Borge Run time ‏ : ‎ 1 hour and 30 minutes Release date ‏ : ‎ May 5, 1998 Date First Available ‏ : ‎ September 29, 2006 Actors ‏ : ‎ Victor Borge, Joseph Green, Marylyn Mulvey Studio ‏ : ‎ Gmg Records Producers ‏ : ‎ Christopher Fahey, James Colias, Thomas Wittbold ASIN ‏ : ‎ 1892562154 Best Sellers Rank: #580,759 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #88,853 in Classical (CDs & Vinyl) Customer Reviews: 4.6 4.6 out of 5 stars 158 ratings","title":"The Best of Victor Borge Acts I and II VHS"});
