db.product.insert({"image":"https://m.media-amazon.com/images/I/61QMM588D6L._AC_SY445_.jpg","quantity":"2","price":"$19.99","cat":"VHS Tape","description":"Join a mighty little mouse as he discovers he has the strength to face his foesand end up the Big Cheesein this rousing musical adventure your family will treasure. Featuring the voices of Ralph Macchio, Dom De Luise and Harvey Korman, this charming adventure is a wonderfully heroic tale thatwill make your family want to stand up and cheer! Welcome to beautiful Thorn Valley, wherethe mice-folk have everything they could possibly need...except a hero. that's why they call upon Timmy Brisby, the youngest son of Jonathan Brisby who once saved them from an evil place called NIMH.There's only one problemTimmy's a novice, so it's necessary for him to go through hero training 101, but before he even has a chance to graduate, Timmy must put his new skills to the test. Taking on NIMH is a big job for a little guy, but Timmy is up to the challenge and before he's through, he's going to prove that no matter one's size, anyone can be a hero.","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 7.32 x 4.19 x 1.12 inches; 6.13 ounces Director ‏ : ‎ Dick Sebast Run time ‏ : ‎ 1 hour and 19 minutes Release date ‏ : ‎ December 22, 1998 Date First Available ‏ : ‎ October 7, 2006 Actors ‏ : ‎ Darleen Carr, Jamie Cronin, Dom DeLuise, Andrew Ducote, Phillip Glasser Studio ‏ : ‎ MGM (Video & DVD) Producers ‏ : ‎ Fang Ding, Jonathan Dern, Kent Lin ASIN ‏ : ‎ 0792839420 Writers ‏ : ‎ Chris Hubbell, Jymn Magon, Robert C. O'Brien, Sam Graham Best Sellers Rank: #393,534 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #4,865 in Children's Music (CDs & Vinyl) Customer Reviews: 4.2 4.2 out of 5 stars 382 ratings","title":"The Secret Of NIMH 2 - Timmy To The Rescue VHS"});
