db.product.insert({"image":"https://m.media-amazon.com/images/I/91rRJxsUCtL._AC_SX522_.jpg","cat":"VHS Tape","description":"When they overhear their stressed-out single mom (Northern Exposure's Cynthia Geary) calling them \"a handful,\" twins Julie and Sarah decide to give mom a break and go to grandma's for Christmas. So they stuff their backpacks and stow away on a city bus, beginning an odyssey that will first find them in a delivery van operated by Roy Rogers-obsessed driver Eddie (soap opera veteran J. Eddie Peck). Then a karate chop to Eddie's head later, they're at the mercy of a happily married pair of thieves (Rhea Perlman, Jerry Van Dyke) and, ultimately, a team of spooked runaway horses posing as reindeer. Luckily Eddie already has a crush on Mom, who manages his favorite mini-mart, and together the pair track down the missing twins, who, meanwhile, are having the ride of their lives. The Olsen twins are in their Full House bloom in this 89-minute made-for-TV movie, which means their brand of innocuous brattiness is still more charming than annoying. Perlman and Van Dyke get to ham it up as lovable criminals, and Geary and Peck find G-rated romance once he adjusts to the idea that his mini-mart sweetie has kids and he learns to share his Lotto winnings. (Suitable for all ages.) --Kimberly Heinrichs","details":"Product details Is Discontinued By Manufacturer ‏ : ‎ No Package Dimensions ‏ : ‎ 7.32 x 4.19 x 1.12 inches; 6.13 ounces Release date ‏ : ‎ September 30, 1997 Date First Available ‏ : ‎ October 25, 2006 Actors ‏ : ‎ Olsen Twins, Geary, Perlman, Peck Studio ‏ : ‎ Warner Home Video ASIN ‏ : ‎ 0790731436 Best Sellers Rank: #334,599 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #4,167 in Children's Music (CDs & Vinyl) Customer Reviews: 4.8 4.8 out of 5 stars 2,964 ratings","title":"To Grandmother's House We Go"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/71QkIBfByvL._SY445_.jpg","quantity":"30","price":"$11.99","cat":"DVD","description":"On the evening of April 10,1996,400 lucky people witnessed the public re-emergence of Alice in Chains on MTV's \"Unplugged\" stage. The 13-song set highlights material from the band's albums \"Dirt\" and \"Alice in Chains\" and the acoustically-based EPs \"Sap\" and \"Jar of Flies,\" plus a brand new song, \"Killer Is Me.\" Song: \"Nutshell,\" \"Brother,\" \"No Excuses,\" \"Sludge Factory,\" \"Down in the Hole,\" \"Angry Chair,\" \"Rooster,\" \"Got Me Wrong,\" \"Heaven Beside You,\" \"Would?,\" \"Frogs,\" \"Over Now,\" \"Killer Is Me\"","details":"Product details Aspect Ratio ‏ : ‎ 1.33:1 Is Discontinued By Manufacturer ‏ : ‎ No MPAA rating ‏ : ‎ Unrated (Not Rated) Product Dimensions ‏ : ‎ 5.38 x 7.54 x 0.62 inches; 2.4 ounces Item model number ‏ : ‎ 8 5 00050148 Media Format ‏ : ‎ Multiple Formats, Color, NTSC Run time ‏ : ‎ 4 hours and 28 minutes Release date ‏ : ‎ October 26, 1999 Actors ‏ : ‎ Alice In Chains Language ‏ : ‎ English (Dolby Digital 2.0 Stereo), English (Dolby Digital 5.1), Unqualified Studio ‏ : ‎ Legacy Recordings ASIN ‏ : ‎ 1573301183 Country of Origin ‏ : ‎ USA Number of discs ‏ : ‎ 1 Best Sellers Rank: #20,367 in Movies & TV (See Top 100 in Movies & TV) #104 in Performing Arts (Movies & TV) #265 in Music Videos & Concerts (Movies & TV) #415 in Special Interests (Movies & TV) Customer Reviews: 4.8 4.8 out of 5 stars 1,766 ratings","title":"Unplugged"});
