db.product.insert({"image":"https://m.media-amazon.com/images/I/51FYG907MSL._SY445_.jpg","price":"$9.93","cat":"DVD","description":"It's pretty tough to beat Jailhouse Rock in terms of sheer entertainment, but Elvis lovers are particularly fond of this 1964 hit. The Big E plays race-car driver Lucky Jackson, who arrives in Las Vegas for an upcoming Grand Prix race. Lucky's car needs a new engine, so he gets a waiter job at a casino and starts working his crooning charms on Rusty Martin (Ann-Margret). It's their on-screen chemistry that makes this flick a lot of fun; Presley never had a better costar than Ann-Margret, and their race-car romance is quintessential 1960s fluff. Then there are the songs, of course, including the snappy title tune, a rockin' rendition of Ray Charles's \"What'd I Say?,\" and \"The Yellow Rose of Texas.\" Viva Las Vegas is one of the Elvis movies that stands the test of time, when the legend was still at his peak. And if you're wondering if the King gets his car fixed in time to win the race, well, check out the movie to find out. --Jeff Shannon","details":"Product details Aspect Ratio ‏ : ‎ 2.35:1 Is Discontinued By Manufacturer ‏ : ‎ No MPAA rating ‏ : ‎ Unrated (Not Rated) Product Dimensions ‏ : ‎ 7.5 x 5.38 x 0.6 inches; 4 ounces Media Format ‏ : ‎ Color, Widescreen, Closed-captioned, NTSC Run time ‏ : ‎ 1 hour and 25 minutes Release date ‏ : ‎ August 20, 1997 Actors ‏ : ‎ Viva Las Vegas Subtitles: ‏ : ‎ English, Spanish, French Language ‏ : ‎ English (Dolby Digital 2.0 Mono), French (Dolby Digital 2.0 Mono), Unqualified (Dolby Digital 1.0) Studio ‏ : ‎ MGM (Video & DVD) ASIN ‏ : ‎ 0792836030 Number of discs ‏ : ‎ 1 Best Sellers Rank: #220,185 in Movies & TV (See Top 100 in Movies & TV) #9,215 in Dance Pop (CDs & Vinyl) #166,546 in DVD Customer Reviews: 4.7 4.7 out of 5 stars 3,865 ratings","title":"Viva Las Vegas"});
db.product.insert({"image":"https://m.media-amazon.com/images/I/71Z97NJWKRL.__AC_SX300_SY300_QL70_FMwebp_.gif","cat":"VHS Tape","description":"For all but the most apathetic viewers, this concert souvenir is enjoyable in inverse proportion to familiarity with the real-life Woodstock '99 festival: the less you know about the hour-to-hour experiences of the audience and the event's violent denouement, the more you can enjoy the show. This 2½-hour summation, which offers one song each from 29 of the artists that appeared, can be viewed as a grab bag of funk, rock, hip-hop, and pop spanning several generations of performers, from show opener James Brown (\"Sex Machine\") to bad-boy rockers Limp Bizkit (\"Show Me What You Got\"), congregating under the would-be \"brand\" (as event promoters have baldly called it) first established on Yasgur's farm 30 years earlier.","details":"Product details Product Dimensions ‏ : ‎ 4.13 x 7.5 x 1 inches; 8 ounces Run time ‏ : ‎ 2 hours and 31 minutes Release date ‏ : ‎ October 19, 1999 Date First Available ‏ : ‎ September 29, 2006 Actors ‏ : ‎ Various Studio ‏ : ‎ Sony Legacy ASIN ‏ : ‎ 073890015X Best Sellers Rank: #649,235 in CDs & Vinyl (See Top 100 in CDs & Vinyl) #242,624 in Rock (CDs & Vinyl) Customer Reviews: 3.8 3.8 out of 5 stars 10 ratings","title":"Woodstock '99"});
